window.bookSummaryJSON = "<p>Princess Inos lived an idyllic life in her fathers' sleepy, backwater kingdom, and she was best friends with her childhood companion, the stableboy, Rap. But when a prophecy seemed to say Inos should be married, she was exiled to the Impire to learn to be a lady. She was far away when Rap's magical talents began to emerge, and it was he who told her of the fate awaiting them both.</p>"; 
